import { BrowserRouter, Routes, Route } from "react-router-dom";
import Template from "./pages/Template";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Template />}>
          <Route index element={<Home />} />
        </Route>
      </Routes>
    </BrowserRouter>
  );
}
export default App;
